642	Google	google.com	\N	\N	133	The Google story begins in 1995 at Stanford University. Larry Page was considering Stanford for grad school and Sergey Brin, a student there, was assigned to show him around. By some accounts, they disagreed about nearly everything during that first meeting, but by the following year they struck a partnership. Working from their dorm rooms, they built a search engine that used links to determine the importance of individual pages on the World Wide Web. They called this search engine Backrub. Soon after, Backrub was renamed Google (phew). The name was a play on the mathematical expression for the number 1 followed by 100 zeros and aptly reflected Larry and Sergey&#39;s mission &ldquo;to organize the world&rsquo;s information and make it universally accessible and useful.&rdquo; Over the next few years, Google caught the attention of not only the academic community, but Silicon Valley investors as well. In August 1998, Sun co-founder Andy Bechtolsheim wrote Larry and Sergey a check for $100,000, and Google Inc. was officially born. With this investment, the newly incorporated team made the upgrade from the dorms to their first office: a garage in suburban Menlo Park, California, owned by Susan Wojcicki (employee #16 and now CEO of YouTube). Clunky desktop computers, a ping pong table, and bright blue carpet set the scene for those early days and late nights. (The tradition of keeping things colorful continues to this day.)	2017-05-06 10:24:33.005797	2017-08-08 14:45:39.438515	\N	\N	\N	100	0	\N	\N	\N	google	t	0	\N
