ly with functional leaders in Product Management, Sales, Marketing, and Business Operations.<p>\n</p>Create and manage financial/operational dashboards to monitor business line performance and to continually analyze business drivers.<p>\n</p>\n<strong>Basic Qualifications<p>\n</p></strong>BA/BS degree in engineering, math, statistics, physics, computer science or related discipline.<p>\n</p>1+ years experience working on an offshore analytics team.<p>\n</p>2+ years working with product companies in the analytics team<p>\n</p>\n<strong>Preferred Qualifications<p>\n</p></strong>2+ years of experience in providing analytical insights to product or business functions.<p>\n</p>Industry experience working with large amounts of real data with SQL (Teradata, Oracle, or MySQL) and R, or other statistical packages.<p>\n</p>Excellent communications skills and strong track record of establishing good work relationship with business partners and delivering results.<p>\n</p>Experience with Hadoop/HDFS and Hive/Pig.<p>\n</p>\n<strong>Experience With Python, Java Script Or Other Scripting Languages.<p>\n</p></strong>Experience with Unix/Linux environment.<p>\n</p>Expertise in applied statistics, understanding of controlled experiments.<p>\n</p>\n<strong>Experience Working With a Global Company.<p>\n</p></strong>Experience presenting insights to executive staff on a regular basis.<p>\n</p>Cross-cultural background and experience.\n    </div>	https://www.linkedin.com/jobs/view/496017958/	\N	14	\N	open	0	0	\N	\N	\N	\N	2135	\N	\N	1	t
