ment </li><li> Prioritization in concert with Product, Platforms, and Operations teams </li><li> Drive project management and execution within your team and crossorganizational dependencies, overseeing completeness of tasks and accuracy of estimates </li><li> Assign people to projects and monitor work progress against estimates </li><li> Be the escalation point for resolving exceptions and clearing roadblocks. </li><li>Maximizing productivity </li><li> Build and maintain a high performance engineering team, guiding decisions, provide training and career counseling, and mentoring for peak performance of the team </li><li> Develop team-level leaders, define clear roles and assign areas of ownership, ensure clear priorities and high standards of accountability, and maximize cross-organizational alignment.<p>\n</p> </li></ul><strong>Basic Qualifications<p>\n</p></strong><ul><li>B.A./B.S. Degree or higher in Computer Science or related technical discipline, or 12+ years of equivalent practical experience. </li><li>4+ years of programming experience in Java, JavaScript, C/C++, C#, Objective-C, Python, and/or Ruby.<p>\n</p> </li></ul><strong>Preferred Qualifications<p>\n</p></strong><ul><li>Experience hiring, mentoring, coaching and developing top engineering talent. </li><li>Experience building and running 24/7 operations of infrastructure systems/distributed large-scale systems.</li></ul>\n    	https://www.linkedin.com/jobs/view/490187959/	\N	29	\N	open	0	0	\N	\N	\N	\N	2139	\N	\N	0	t
