292	\N	\N		2017-11-02 12:08:02.866202	2017-12-02 12:45:19.028607	\N	Software Engineering Manager	\N	\n      <h2 class="jobs-description-content__title  jobs-box__title">Job description</h2>\n<!---->      <strong><p>Banyan is a highly disruptive award winning startup operating in the recycling and waste management space in India. This is an exciting opportunity for talented individuals and leaders who are passionate about sustainability and are excited to make a positive social impact in India. You will directly work with the executive team and influence strategic decision making. </p><p>\n</p><p>Banyan's IT platform forms the backbone of the organization. The suite of products and services we are building not only empowers the entire organization, right from customer discovery to distribution of recycled goods, but also helps cities make waste management more efficient, effective and economical. We espouse a data-driven culture; data is our north star and informs all decisions, both strategic and operational. </p><p>\n</p><p>We are seeking a dynamic and experienced engineer manager, based in (or willing to relocate to) Hyderabad, Telangana, with expertise in building and nurturing teams that have delivered large scale commercial software applications targeting a variety of form factors (e.g: Android, iOS, HTML5, etc). </p><p>\n</p><p>The selected candidate must have </p><p>\n</p><ul><li><p>7+ years of relevant engineering work experience and 4+ hands-on technical management experience </p></li><li><p>Exceptional coding abilities and experience with architectural patterns of large, high-scale applications </p></li><li><p>Track record in partnering with recruiting to build incredible engineering teams </p></li><li><p>Actively coached and mentored team members in their careers </p></li><li><p>Been actively involved in setting product strategy </p></li><li><p>Independently started self-sustaining teams </p></li><li><p>Consistently made culture choices that positively impact all of engineering </p></li><li><p>Shipped several large scale projects with multiple dependencies across teams </p></li><li><p>Bachelors or Masters degree in engineering, math, physics or electrical engineering </p></li></ul><p>\n</p><p>Other requisite skills </p><ul><li><p>Proficiency in Computer Science fundamentals - object oriented design, data structures, algorithm - design, problem solving, and complexity analysis </p></li><li><p>Proficiency in at least one modern object oriented language such as C++, Java or C# </p></li><li><p>Experienced in web technologies such as JavaScript, JQuery, JQuery mobile, AJAX and HTML5 </p></li><li><p>Experienced in building complex mobile applications on Android , iOS or Windows Phone platforms that have been successfully delivered to customers </p></li><li><p>Experienced in delivering low-latency, consumer-internet-scale web services operating in a 24x7 environment </p></li><li><p>Experienced in relational database concepts with a solid knowledge of Oracle, SQL and PL/SQL </p></li><li><p>Experienced in non-relational (NoSQL) database technologies </p></li><li><p>Experienced in building and deploying on cloud platforms such as AWS, Heroku, Google App Engine, etc </p></li><li><p>Strong knowledge of various data warehousing methodologies and data modeling concepts. Hands on modeling experience is highly desired </p></li><li><p>Experience with Agile (SCRUM, RUP, XP), OO modeling, web services, UNIX, middleware and databases </p></li><li><p>Knowledge of professional software engineering practices for the full software development life cycle including coding standards, code reviews, source control management, build processes, testing, and operations </p></li><li><p>Experience mentoring and training the engineering community on complex technical issues </p></li><li><p>Proven track record of delivery </p></li><li><p>Sharp analytical abilities and proven design skills</p></li></ul></strong>\n    	https://www.linkedin.com/jobs/view/447873668/	\N	493	\N	open	0	0	\N	\N	\N	\N	2147	\N	\N	0	t
