d external organizations and individuals </p> <p>         Strong hands-on technical background in Program Management and hands-on development experience </p> <p>         Familiarity with Oracle Database, WLS, various open source products or similar competitive offerings </p> <p>         Experience managing Cloud releases and/or Agile product development </p> <p>         Ability to work with large teams spread across geographies in a dynamic and challenging environment </p> <p>         should have high energy level and passion for technology </p> <p><strong>Detailed Description and Job Requirements</strong> </p> <p>Manage the development and implementation process of a specific company product.</p><p>\n</p> <p>\n</p>Manage the development and implementation process of a specific company product involving departmental or cross-functional teams focused on the delivery of new or existing products. Plan and direct schedules and monitor budget/spending. Monitor the project from initiation through delivery. Organize the interdepartmental activities ensuring completion of the project/product on schedule and within budget constraints. Assign and monitor work of systems analysis and program staff, providing technical support and direction.<p>\n</p> <p>\n</p>Work is non-routine and very complex, involving the application of advanced technical/business skills in area of specialization. Leading contributor individually and as a team member, providing direction and mentoring to others. BS or MS degree or equivalent experience relevant to functional area. Seven years of project management, product design or related experience preferred.<p></p><p></p><p></p>\n    	https://www.linkedin.com/jobs/view/495258904/	\N	29	\N	open	0	0	\N	\N	\N	\N	2152	\N	\N	0	t
