293	\N	\N		2017-11-02 12:11:33.724957	2017-12-02 12:45:19.028607	\N	Director Software Engineering	\N	\n      <h2 class="jobs-description-content__title  jobs-box__title">Job description</h2>\n<!---->      <p><strong>About CA:</strong> </p> <p>CA Technologies is a Fortune 1000 company with a startup mentality  and were searching for incredible, bright talent to dominate in the marketplace. Sure, CA has been a leading software company for four decades, with a global customer base that includes the majority of the Fortune 2000 - but what excites us today is the opportunity to redefine the future of our industry in the age of the cloud, mobile, social and big data. We have a daring vision and a powerful, expanding solution set that helps the worlds most successful companies realize their boldest objectives. </p> <p>  </p> <p>What makes CA unique in our ability to help customers is more than the sum of our experience and expertise-Its how we view the word, who we are, how we live and how we work. In fulfilling our mission, its not just what we do that matters. Its what we believe. </p> <p>  </p> <p>For more information, visit https://www.ca.com/us.html </p> <p>  </p> <p><strong>Role Summary:</strong></p><p>\n</p> <p></p> <p>A servant leader who guides, coaches, and mentors managers and teams representing the Software Engineering function for a number of Agile Teams, or a small to medium-sized Release Train, towards high performance. This role is primarily focused on the management and development of people and practices and enables self-directed teams to successfully execute against their goals within an Agile organization in support of corporate vision and strategy. </p> <p>  </p> <p>  </p> <p><strong>Who we are seeking</strong><strong>:</strong> </p> <p>Do you want to help eliminate barriers between ideas and business outcomes? We want you to bring your unique experiences and creative ideas to the table. CA Technologies provides software and solutions that help our customers to develop, manage, and secure complex IT environments to increase productivity and enhance competitiveness in their businesses. Its our aim to encourage global collaboration and results-oriented innovation, while supporting and developing our talented people and our communities. CA Technologies will empower you to drive authentic success, for both the business and yourself in the application economy </p> <p>  </p> <p>An entrepreneurial fast paced mentality is critical for success in this position: a passionate can-do attitude, exceptional communication skills, and the ability to collaborate while acting as a thought leader in your area of expertise will serve you well at CA Technologies. Does this sound like a challenge you're ready for? </p> <p>The perfect candidate for this role will have a demonstrated record of success in positions of increasing responsibility over the course of their career. An ideal background will include: </p><p></p><p>\n</p> <p></p> <ul> <li>Generally works without consulting their manager. </li> <li>Independent decisions are made daily. </li> <li>Examples of typical decisions without manager consultation: </li> <ul> <li>Identify goals and tracking metrics to ensure objectives are met and recommend process improvements. </li> <li>Balance available resources to support team objectives. </li> <li>Handle escalations that cannot be resolved independently by direct reports. </li> </ul> <li>Typically has 11+ direct reports. </li> <li>Typically has a total staff of 26-50. </li> <li>Typically has a geographic focus of Region (APJ/EMEA/LA/NA). </li> <li>Typically manages a total budget of up to $10 million USD. </li> </ul> <p>  </p> <p>Typically 12 or more years of experience in software development, Level 2 Support or related field with 7 or more years in a management capacity and at least 2 years in an Agile organization environment. Experience managing development projects and engineering teams. </p> <p>  </p> <strong>Skills &amp; Competencies:</strong><ul> <li>Trusting and trustworthy. </li> <li>Ability to work without direction. </li> <li>Knowledge of the field's concepts, practices, and procedures. </li> <li>Demonstrate a growth mind-set, seeks feedback often. </li> <li>Strong ability to motivate others. </li> <li>Good coaching and mentoring skills. </li> <li>Ability to easily build new relationships. </li> <li>Comfortable with constructive conflict. </li> <li>Strong verbal and written communication skills; ability to clearly communicate and motivate teams toward a common goal. </li> <li>Active listening and respect for other's opinions and ideas; invite dissent. </li> <li>A servant leader with a demonstrated ability to support self-organizing teams. </li> <li>Willingness to take calculated risks. </li> <li>Ability to make decisions under pressure, and to own the outcome. </li> <li>Proficient in Agile methodologies and Agile best practices. </li> </ul> <p><strong> </strong> </p> <p><strong>Preferred Education:</strong> </p> <p>Bachelor's degree or global equivalent in a related field. </p> <p><strong> </strong> </p> <p><strong></strong></p><p><strong>\n</strong></p> <p></p><p><strong>How you will stand out:</strong> </p> <p><strong> </strong> </p> <p><strong><i>Lead the Organization</i></strong> </p> <ul> <li>Communicate CA Technologies vision and goals to multiple teams. </li> <li>Encourage employees to share feedback on the team, organization, and company via employee opinion surveys and other formal and informal channels. </li> <ul> <li>Share and respond to feedback as appropriate. </li> </ul> <li>Identify goals and tracking metrics to ensure objectives are met and recommend process improvements. </li> <li>Support organizational capacity through staffing, budget/compensation planning, skills development, and acquisition of required tools and technologies: </li> <ul> <li>Conduct regular succession planning activities for key roles within the Agile organization. </li> <li>Manage and approve staff performance and discipline plans. </li> <li>Help to attract, recruit, retain, and develop top engineering talent. </li> </ul> <li>Support continuous improvement of Software Engineering capability. </li> <ul> <li>Stay abreast of and share industry/technology trends relevant to the Software Engineering discipline. </li> </ul> <li>Stay focused on customer/market needs. </li> <li>Collaborate effectively and routinely share information and best practices across all functions to ensure organizational effectiveness. </li> <li>Ensure staff understand and adhere to corporate policies and procedures. </li> <li>Handle escalations that cannot be resolved independently by direct reports, and may similarly escalate to more senior management as appropriate. </li> <li>Balance available resources to support the objectives of multiple teams. </li> <ul> <li>Develop budget for approval, and manage budget once approved. </li> </ul> <li>May represent CA in industry groups and events to create internal and external awareness of functional solutions. </li> <li>May represent company in relations with major customers, suppliers, bankers, government agencies and both channel and alliance partners. </li> <li>Meet regularly with employees one-on-one for Pulse Conversations and coaching. </li> <li>Foster a growth mind-set in all employees: </li> <ul> <li>Support employees in setting and attaining professional and development goals. </li> <li>Coach and mentor employees on career and personal development, team collaboration and Agile practices. </li> <li>Support continuous learning. </li> </ul> </ul> <p><strong> </strong> </p> <p><strong></strong></p><p><strong>\n</strong></p> <p></p><p><strong>More About Working at CA:</strong> </p> <p>At CA Technologies, its easy to make a big impact. Thats because we help some of the worlds most powerful companies bring their best and brightest ideas to life. And we do it together. Whether youre in sales, marketing, technology or corporate, youll be part of great team at CA. </p> <strong><p><strong></strong></p><p><strong>\n</strong></p> <p></p>Bring what you bring.</strong> <p></p><p>\n</p> <p></p><p>Passion. Innovation. Weirdness. Whatever. No matter what you bring to the table, theres a place for you at CA Technologies. Were here to do amazing things, and we want diverse talent to lead the way. What will you bring? </p> <p>  </p> <p>If you want to fulfill your potential, be acknowledged for your achievements, and be given autonomy to make decisions for your business and customers; if you want to work with a company that respects you as an individual - recognizing both your needs at work and your responsibilities outside of it - then CA Technologies is where you belong </p> <p>  </p> <p>For more information, visit www.CA.com/careers   </p> <p> </p>\n    	https://www.linkedin.com/jobs/view/463303021/	\N	493	\N	open	0	0	\N	\N	\N	\N	2149	\N	\N	0	t
