ystem design very well </li><li>Good at problem solving and innovative thinking </li><li>Love to be Hands-on. </li><li>The ability to envision the future engineering needs of the company  Plan and implement accordingly<p>\n</p> </li><li>The creativity to do things differently </li><li>Excellent logic and problem-solving skills </li><li>The ability to think and plan strategically for the technical needs of the company </li><li>Skill at collaboratively overcoming objections from team members with dominant personalities </li></ul><p></p><p>\n</p> <p></p><p><strong>You Will:</strong> </p><ul> <li>Predictably deliver high-quality, scalable software </li><li>Provide engineering execution excellence, as well as technical vision and direction, to ensure the development team is aligned with the strategy of the company </li></ul><ul> <li>Define objectives and track results for team members in a supportive, motivating, and fact-driven way </li> <li>Proactively identify and resolve issues relating to people, product, tech, and process </li> <li>Work across other departments to get alignment on dev-related items </li> <li>Coach team members on coding practices and in making business-driven decisions </li><li>Lead and manage an effective engineering function to support productive development and quality of life for the development team </li><li>Build a development dream-team, including recruiting, hiring, mentoring and performance management </li><li>Work closely with the company leaders including the technical founder, product, operations, and Customer Care to strategically </li><li>Use fact-based analyses to deliver recommendations  </li><li>Make decisions related to managing the software development process and team </li></ul><p><strong> </strong> </p><p><strong> </strong> </p><p><strong>Why join Swiggy ? </strong></p><p>  </p><p>At Swiggy, we're building an on-demand food delivery platform that is delighting many customers across India with time-guaranteed deliveries and an obsession with keeping customer service levels ridiculously high. We are changing the course of online food delivery in the country, one city at a time! </p><p></p><p>\n</p> <p></p><p>Swiggy offers you an exciting and challenging environment in which you can grow and thrive. We are offering you roles in which you will be fundamentally impacting the success of the company. </p><p></p><p>\n</p> <p></p><p>At Swiggy, we are looking for people who are concerned about the customer at all times. Customer centricity is a key tenet of all our processes. </p><p>We value creativity, hard work, initiative and radical ideas.</p>\n    	https://www.linkedin.com/jobs/view/437868805/	\N	14	\N	open	0	0	\N	\N	\N	\N	2161	\N	\N	1	t
