d platform documentation feedback </li> <li>Work closely with product management and UX design teams to define and refine apps feature specifications </li> <li>Evangelize the Flock Platform and Apps Ecosystem in dev communities. </li> <li>Manage individual project priorities, deadlines and deliverables </li> <li>Participate actively in recruitment and nurturing of engineers as awesome as you </li> </ul> <p>  </p> <p><strong>Requirements</strong> </p> <p>  </p> <ul> <li>2+ years of experience in Java programming. Experience with golang, python or other languages is a plus </li> <li>Good understanding of HTML, CSS and JavaScript will be a plus. </li> <li>Good knowledge of one or more relational databases like MySQL/Postgres </li> <li>Experience with IaaS clouds like AWS/Google Cloud, Azure, OpenStack etc </li> <li>Experience in a startup environment is a plus </li> <li>Good communication skills. Putting your thoughts through to other stakeholders in a cohesive manner is not a problem for you.</li></ul>\n    	https://www.linkedin.com/jobs/view/449675433/	\N	29	\N	open	0	0	\N	\N	\N	\N	2171	\N	\N	1	t
