ey PM documentation is developed and maintained, including PID, Project Plan, Risk and Issues register, weekly reports, stakeholder reports, Lessons learned etc. The project managed could be part of a larger program managed by a senior project manager or a program manager and the documentation requirements would be customized as per the program requirements </p></li></ul> <p><strong> </strong> </p> <p><strong>Other accountabilities (optional)</strong> </p> <p><strong>Stakeholder Management </strong></p> <p>  </p> <ul><li><p>Establishing a single point of contact for the sponsor for the duration of the project and agreeing escalation paths for all stakeholders </p></li><li><p>Managing all communication during the project life cycle ensuring a high level of customer satisfaction throughout the project. </p></li><li><p>Managing internal and external suppliers to deliver the project on time and within cost tolerances. </p></li></ul> <p>  </p> <p><strong>Quality and Process</strong> </p> <p>  </p> <ul><li><p>Ensuring that all project documentation is maintained to a high standard and that all project deliverables meet the sponsors expectations of performance and quality. </p></li><li><p>Ensuring that financial systems and project reporting tools are maintained to reflect the state of project progress. </p></li></ul> <p>  </p> <p><strong>Key performance indicators (financial and non-financial)</strong> </p> <p>  </p> <ul><li><p>Project milestones executed as per baselined schedule </p></li><li><p>Project is run within committed budget </p></li><li><p>Project scope delivered as per sponsor requirement </p></li><li><p>Project deliverables meet the quality and signoff requirements of sponsor and operational teams<strong>  </strong> </p></li></ul> <p>  </p> <p><strong>Relationships and key contacts </strong></p> <p>  </p> <ul><li><p>The project virtual team can span the entire organization  network architecture/engineering, internal development, product management, CCEO functional areas </p></li><li><p>The project steering group will be comprised of senior stakeholders from the teams that are engaged on the project, typically senior managers, directors, VPs, EVPs </p></li><li><p>The PMO team offers tools and reporting support to the PM team. </p></li></ul> <p>  </p> <p><strong> </strong> </p> <p><strong>Role specific requirements</strong> </p> <p><strong>Skills &amp; Experience </strong></p> <p>  </p> <ul><li><p>Proven experience as a Project Manager managing multiple projects. </p></li><li><p>Direct experience of working in a structured project environment. </p></li><li><p>Previous working knowledge of internet and telecommunications networking technologies and related IT systems </p></li><li><p>Proven experience as a Project Manager managing multiple projects. </p></li><li><p>Demonstrable business and financial understanding. Must have a good understanding of their business, its customers and market drivers </p></li></ul> <p>  </p> <p><strong>Qualifications </strong></p> <p>  </p> <ul><li><p>MSP, PRINCE2 and/or industry recognized programme management qualification </p></li><li><p>Excellent operational, programme and presentation skills </p></li><li><p>Very good communication and negotiation skills </p></li><li><p>Excellent Inter-personnel skills </p></li><li><p>Personal drive, highly self-motivated and self-organized </p></li><li><p>Excellent Team Player and ability to work in an international team </p></li><li><p>Flexibility and creativity </p></li><li><p>Fluent in English (written and spoken) will be beneficial </p></li></ul>\n    	https://www.linkedin.com/jobs/view/477840304/	\N	29	\N	open	0	0	\N	\N	\N	\N	2237	\N	\N	1	t
