ty by fighting spam, fraud and abuse, and develop and communicate state-of-the-art product policies. The Trust and Safety team reduces risk and protects the experience of our users and business partners in more than 40 languages and across Google's expanding base of products. We work with a variety of teams from Engineering to Legal, Public Policy and Sales Engineering to set policies and combat fraud and abuse in a scalable way, often with an eye to finding industry-wide solutions. Trust and Safety team members are motivated to find innovative solutions, and use technical know-how, user insights and proactive communication to pursue the highest possible quality and safety standards for users across Google products.<br><br><strong> Responsibilities <br></strong><ul>\n<li>Manage and develop a high-performing engineering team.</li> <li>Lead design and development efforts for abuse-fighting systems used within Trust and Safety.</li> <li>Work with Product and Engineering teams across Google to integrate with other abuse-fighting systems.</li> <li>Develop metrics to measure growth and performance of the team.</li> <li>Execute special projects involving cross-product abuse prevention, quantitative analysis and strategy development.<br>\n</li>\n</ul>\n<strong> Qualifications <br><br></strong>Minimum qualifications:<ul><li>BS degree in Computer Science or other technical field or equivalent practical experience.<br>\n</li></ul>Preferred qualifications:<ul>\n<li>7 years of experience in technology industry; software engineering experience.</li> <li>Ability to work with Engineering, Product Manager, and Sales teams to improve signals and products and to align incentives.</li> <li>Ability to effectively influence and communicate cross-functionally with all levels of management within Google.</li> <li>Excellent oral and written communication skills. <br>\n</li>\n</ul>At Google, we dont just accept difference - we celebrate it, we support it, and we thrive on it for the benefit 