andle high-stress situations with zen. Flexibility with work timings/schedule and availability is hugely appreciated.</div></div></div>\n</div>	https://www.linkedin.com/jobs/view/265532157?trkInfo=searchKeywordString%3AEngineering%2CsearchLocationString%3A%252C%2B%2Cvertical%3Ajobs%2CpageNum%3A1%2Cposition%3A23%2CMSRPsearchId%3A3360d786-dd6b-48d9-89d5-c607b69e815d&refId=3360d786-dd6b-48d9-89d5-c607b69e815d&trk=jobs_jserp_job_listing_text	\N	15	https://www.urbanladder.com/careers?src=g_footer	Closed	0	0	\N	\N	\N	\N	10	\N	\N	1	t
190	\N	\N	https://www.facebook.com/careers/department?req=a0I1200000JXtPiEAL&ref=a8lA00000004CFAIA2	2017-01-26 11:07:39.63061	2017-12-02 12:45:19.028607	\N	Head of Research & Insights, Media Partnership - India	t	<div class="summary">\n<h3>Job description</h3>\n<div class="content"><div class="description-section"><div class="rich-text" itemprop="description">Facebook's mission is to give people the power to share, and make the world more open and connected. Through our growing family of apps and services, we're building a different kind of company that helps billions of people around the world connect and share what matters most to them. Whether we're creating new products or helping a small business expand its reach, people at Facebook are builders at heart. Our global teams are constantly iterating, solving problems, and working together to make the world more open and accessible. Connecting the world takes every one of usand we're just getting started.<br><br>Facebook is seeking a leader for research and consumer insights in the media partnerships team. Media team manages strategic relationships with our key media partners &amp; public figures across Entertainment, News &amp; Sports for public content on Facebook. The team is the face of Facebook to our external relationships and gets to work with some of the biggest celebrities, atheletes, journalists, talents, movie studios, news publishers &amp; media companies across India. This role will play a pivotal role in defining various content strategies for different verticals, deep dive into insights and research both on and off Facebook for strategizing media content needs of people &amp; support partners with strategic insights for their presence on Facebook. The person will develop and implement key strategic initiatives, from building tools, to measuring engagement around major events, to understanding the impact of conversations by global influencers, to understanding engagement around specific content verticals (e.g., Sports, News) on Facebook and Instagram. This person should be comfortable dealing with external research agencies as well as cross-functionally with internal colleagues in Product, Engineering, Operations, Marketing etc to develop and activate insights about how people find and consume digital news and entertainment &amp; meet the strategic objectives of partners and Facebook. This position is located at Mumbai, India.<br><br><strong>Responsibilities</strong><ul>\n<li>Develop research and measurement strategy and manage prioritization of initiatives across internal and external stakeholders</li>\n<li>Work closely with analysts on the Media Partnerships Research team to understand how major media publishers, influencers, and public figures in India are using Facebook and Instagram to connect and share with people around the world</li>\n<li>Lead content planning and partnerships, backed by strong reaserch and insights</li>\n<li>Develop a robust internal network of coworkers working on a variety of related initiatives and become an internal go-to expert on how and why mass audiences find and consume content on Facebook</li>\n<li>Identify trends and actionable insights to drive strategic partnerships and industry communications</li>\n<li>Synthesize a wide variety of inputs from different stakeholders into coherent narratives and action plans</li>\n<li>Work with global team to scale programs and drive adoption across priority markets</li>\n<li>Be an internal advocate with cross-functional teams including product, product marketing, engineering, and communications  for partner and industry priorities</li>\n<li>Track, analyze and communicate key quantitative metrics and business trends to managed partners &amp; monitor progress</li>\n<li>Be an internal advocate for the partners &amp; advice product and other teams on the needs of the market</li>\n<li>Represent Facebook at industry events and in meetings with senior executives from other companies</li>\n</ul>\n<