sign and implement platforms for monitoring, log processing, metrics collection and data visualization<br> </li>\n<li>Script and code tools for automation and efficient management of infrastructure and platforms<br> </li>\n<li>System and infrastructure configuration management<br> </li>\n<li>Infrastructure and platform security<br> </li>\n<li>Project management using agile methodologies like Scrum or Kanban<br> </li>\n<li>Infrastructure and platform cost management<br> </li>\n<li>Lead and mentor a team of Operations Engineers<br> </li>\n<li>Liaise with geographically distributed application development teams to drive operational best practices<br> </li>\n<li>Liaise with external vendors like Amazon and work with Telecom providers<br> </li>\n</ul> <br><strong>Skills</strong><br>You are an expert with some of the following:<br> <br><ul>\n<li>In depth Linux/Unix knowledge, good understanding the various linux kernel subsystems (memory, storage, network etc)<br> </li>\n<li>DNS, TCP/IP, Routing, HA &amp; Load Balancing<br> </li>\n<li>Configuration management using tools like Salt, Puppet or Chef<br> </li>\n<li>AWS </li>\n<li>Apache Hadoop<br> </li>\n<li>SQL and NoSQL databases like MySQL, PostgreSQL, MongoDB and HBase<br> </li>\n<li>Build and packaging tools like Jenkins and RPM/Yum<br> </li>\n<li>HA and Load balancing using tools like the Elastic Load Balancer and HAProxy<br> </li>\n<li>Monitoring tools like Nagios or similar<br> </li>\n<li>Log management tools like Logstash/Syslog/ElasticSearch or similar<br> </li>\n<li>Metrics collection tools like Ganglia, Graphite, OpenTSDB or similar<br> </li>\n<li>Agile Project Management<br> </li>\n<li>Amazon Web Services<br> </li>\n<li>Programming in a high level language like Python or Ruby. Experience with a JVM language like Java/Clojure/Scala is a plus<br> </li>\n<li>Working with Git, various git workflows</li>\n</ul>\n</div></div></div>\n</div>	https://www.linkedin.com/jobs/view/245025337?trkInfo=searchKeywordString%3AEngin