es:<br><br>\tRoadmap and vision <br>- Collaborate closely with product management to drive the product and technology roadmap to help accelerate LinkedIn's member growth, engagement and monetization efforts.<br>- Own the integrity of solutions, ensuring best practices are followed, not just in technical design and implementation, but in quality of the code.<br>- Jointly develop and own key business, scalability and availability metrics and actively set and achieve goals<br><br>\tProduction integrity <br>- Ensure proactive monitoring, alerting and response to production issues.<br>- Develop strategies to maintain production integrity<br>- Determining how bugs should be resolved and which parts of the system should be rewritten if any.<br><br>\tProject management<br>- Prioritization in concert with Product, Platforms, and Operations teams<br>- Drive project management and execution within your team and crossorganizational dependencies, overseeing completeness of tasks and accuracy of estimates<br>- Assign people to projects and monitor work progress against estimates<br>- Be the escalation point for resolving exceptions and clearing roadblocks.<br><br>\tMaximizing productivity<br>- Build and maintain a high performance engineering team, guiding decisions, provide training and career counseling, and mentoring for peak performance of the team<br>- Develop team-level leaders, define clear roles and assign areas of ownership, ensure clear priorities and high standards of accountability, and maximize cross-organizational alignment.<br><br><br>Basic Qualifications:<br><br>\tB.A./B.S. Degree or higher in Computer Science or related technical discipline, or 12+ years of equivalent practical experience. <br>\t5+ years of experience in managing teams focusing on consumer Internet products.<br>\t4+ years of programming experience in Java, JavaScript, C/C++, C#, Objective-C, Python, and/or Ruby.<br><br><br>Preferred Qualifications:<br><br>\tExperience hiring, mentoring, coaching 