erform regular performance evaluation and share and seek feedback.</li> <li>Operate with scale and speed amidst flux, there is just a LOT happening. </li> <li>Mentor your team! Our world-class software engineers are just getting started -- and as a manager, you guide the way.</li> <li>Work closely with Product Management, Business Development and Operations team and enable them by providing scalable and high quality technology solutions at a rapid pace</li> <li>Set up best practices for development and champion their adoption and at the same time Architect and design technically robust, flexible and scalable solutions</li> <li>Work with designers, business analysts, and product managers to estimate and plan projects in an Agile environment</li> <li>Perform well in uncertainties and collaborate and work with unclear interfaces to other teams in our rapidly evolving organizations</li> <li>Have high technical competence, strong technical background with track record of individual technical accomplishments  Ability to play the role of the architect for the team</li> <br><br>\n</ul>\n<strong><u>What Experience Wed Like You To Have<br></u></strong><ul>\n<li>Excellent leadership skills to mentor the engineers under you.</li> <li>Deep understanding of technologies and architecture in a highly scalable and available set-up.</li> <li>Deep understanding and expertise with highly transactional, large relational and complex systems.</li> <li>Strong object oriented design skills, and an uncanny ability to design intuitive module and class-level interfaces</li> <li>Superior project management skills to manage multi-engineer projects and experience of delivering high quality projects on time</li> <li>Around 9 years of experience with technology depth as well as good people skills</li> <li>A BE/BTech in Computer Science or some equivalent.</li>\n</ul>\n</div></div></div>\n</div>	https://www.linkedin.com/jobs/view/252504357?trkInfo=searchKeywordString%3AEngineering%2CsearchLocationSt