n hypothesis testing to empower people to come up with ideas.<p>\n</p><strong>What Youll Get<p>\n</p></strong>As a member of the Checkout team you will be driving HomeAway's engineering culture, by building, evangelizing and supporting our multi-tier Checkout Platform. Youll have the chance to work with highly scalable Web application and the latest industry tools ensuring no chance of boredom. Our ever-growing footprint will give you the opportunity to work at scale while being creative in an agile team. Youll be joining a team that grows together, and people go out of their way to help each other succeed. Youll also get to work with stakeholders across the globe gaining international experience in a fast-paced eCommerce industry all while working in an incredible office space!<p>\n</p><strong>Responsibilities<p>\n</p></strong>Design of the overall architecture of the web application Implementation of a robust set of services and APIs to power the web application Building reusable code and components/libraries for future use Optimization of the application for maximum speed and scalability Implementation of security and data protection Translation of UI/UX wireframes to visual elements Integration of the front-end and back-end aspects of the web application You are involved in usage/performance forecasting/modelling and monitoring. You are a self-starter and can work independently on technical projects at the same time work collaboratively with project team members through an agile development.<p>\n</p><strong>Qualifications<p>\n</p></strong><ul><li>As Full Stack Developer, your primary focus will be on developing user interface components and implementing them using JS based technologies like ReactJs / NodeJs . Basic qualification would include</li><li>Experience in Full Stack development Strong proficiency in JavaScript, including DOM manipulation and the JavaScript object model Hands-on knowledge in following technologies</li><li>JavaScript (ES6/ES2015)</li><li>Bootstrap</li><li>JS MV* frameworks like Backbone.js</li><li>HTML5, semantic &amp; accessible</li><li>CSS3 &amp; understanding of preprocessors (Less/SASS)</li><li>Client side templating (mustache, handlebars etc.,)</li><li>Excellent problem solving skills. Familiarity with RESTful APIs A knack for benchmarking and optimization<p>\n</p></li></ul>Expedia is committed to creating an inclusive work environment with a diverse workforce.All qualified applicants will receive consideration for employment without regard to race, religion, gender, sexual orientation, national origin, disability or age.<p>\n</p>\n    	https://www.linkedin.com/jobs/view/442079388/	\N	18	\N	open	0	0	\N	\N	\N	\N	2132	\N	\N	0	t
